import React, { Component } from 'react';

import axios from 'axios';

class restapi extends Component {
    constructor(props) {
        super(props);
        this.state={users:[]}

    }

    render() {
        return (
            <>
<div className="p-5">
                 <h2>Axios Rest Api Calls</h2> 
                 
                     <table className="table table-sucses w-85 mx-auto my-3">
                             <thead>
                                 <tr>
                                 <th>EMPID</th>
                                 <th>USER NAME</th>
                                 <th>EMAIL</th>
                                 <th>PHONE</th>
                                 <th>PASSWORD</th>
                                 <th>PACTIONS</th>
                                 </tr>
                             </thead>

                         <tbody className="table table-dark">
                             {this.state.users.map( (res,index)=>{
                                 return(<tr>
                                         <td>{res.id}</td>
                                         <td>{res.username}</td>
                                         <td>{res.email}</td>
                                         <td>{res.phone}</td>
                                         <td>{res.password}</td>
                                    
                                     </tr>
                                 )
                             }
                             )
                             }

                             
                         </tbody>
                     </table>
                 
            </div>
         
            </>
        );
    }
    componentDidMount(){axios.get('https://fakestoreapi.com/users')
                             .then((apiresult)=>this.setState({users: apiresult.data}))



    }
}



export default restapi;
